import React, { useEffect, useState } from 'react'

const UPPER_OFFSET = 65;

function encrypt(message, keyword) {
    message = message.replace(/[^a-zA-Z]/g, '').toUpperCase();
    keyword = keyword.replace(/[^a-zA-Z]/g, '').toUpperCase();
    
    let encryptedMessage = '';

    // message: "home"
    // key: "punk"

    let encrypedMessage = message.split('')
.map((char, i) => {

});

    for (let i = 0; i < message.length; i++) {
        const msgCharOffset = message.charCodeAt(i) - UPPER_OFFSET;
        const keywordCharOffset = keyword.charCodeAt(i % keyword.length) - UPPER_OFFSET;

        const encryptedChar = String.fromCharCode((msgCharOffset + keywordCharOffset) % 26 + UPPER_OFFSET);
        encryptedMessage += encryptedChar;
    }

    return encryptedMessage;
}

function decrypt(encryptedMessage, keyword) {
    // Remove non-alphabetic characters and convert to uppercase
    encryptedMessage = encryptedMessage.replace(/[^a-zA-Z]/g, '').toUpperCase();
    keyword = keyword.replace(/[^a-zA-Z]/g, '').toUpperCase();

    let decryptedMessage = '';

    for (let i = 0; i < encryptedMessage.length; i++) {
        const encryptedCharOffset = encryptedMessage.charCodeAt(i) - UPPER_OFFSET;
        const keywordCharOffset = keyword.charCodeAt(i % keyword.length) - UPPER_OFFSET;

        const decryptedChar = String.fromCharCode((encryptedCharOffset - keywordCharOffset + 26) % 26 + UPPER_OFFSET);
        decryptedMessage += decryptedChar;
    }

    return decryptedMessage;
}

const Home = () => {

    useEffect(() => {

    })

    const [message, setMessage] = useState('');
    const [key, setKey] = useState('');
    const [encryptedMessageOutput, setEncryptedMessageOutput] = useState('');
    const [encryptedMessage, setEncryptedMessage] = useState('')
    const [decryptedMessageOutput, setdecryptedMessageOutput] = useState('');

    const handleMessageChange = (e) => {
        setMessage(e.target.value);
    };

    const handleKeyChange = (e) => {
        setKey(e.target.value);
    };

    const handleFormEncryptSubmit = (e) => {
        e.preventDefault();
        
        setEncryptedMessageOutput(`Encrypted Message: ${encrypt(message, key)}`);
    };

    const handleEncryptedMessageChange = (e) => {
        setEncryptedMessage(e.target.value);
    };

    const handleFormDecryptSubmit = (e) => {
        e.preventDefault();
        
        setdecryptedMessageOutput(`Decrypted Message: ${decrypt(encryptedMessage, key)}`);
    };

    return (
        <div className="home">
            <div className="split left">
                <form onSubmit={handleFormEncryptSubmit}>
                    <div>
                        <label htmlFor="message">Message:</label>
                        <input 
                            type="text" 
                            id="message" 
                            value={message} 
                            onChange={handleMessageChange} 
                        />
                    </div>
                    <div>
                        <label htmlFor="key">Key:</label>
                        <input 
                            type="text" 
                            id="key" 
                            value={key} 
                            onChange={handleKeyChange} 
                        />
                    </div>
                    <button type="submit">Submit</button>
                </form>
                <section className="output">
                    <h3>{encryptedMessageOutput}</h3>
                </section>
            </div>
            <div className="split right">
                <form onSubmit={handleFormDecryptSubmit}>
                    <div>
                        <label htmlFor="encryptedMessage">Encrypted Message:</label>
                        <input 
                            type="text" 
                            id="encryptedMessage" 
                            value={encryptedMessage} 
                            onChange={handleEncryptedMessageChange} 
                        />
                    </div>
                    <div>
                        <label htmlFor="key">Key:</label>
                        <input 
                            type="text" 
                            id="key" 
                            value={key} 
                            onChange={handleKeyChange} 
                        />
                    </div>
                    <button type="submit">Submit</button>
                </form>
                <section className="output">
                    <h3>{decryptedMessageOutput}</h3>
                </section>
            </div>
        </div>
    );
}

export default Home
